# Write Python code from here
def check_anagram(a,b):
    dp1=dict()
    for i in a:
        if i not in dp1:
            dp1[i]=1
        else:
            dp1[i]+=1
    dp2 = dict()
    for i in b:
        if i not in dp2:
            dp2[i] = 1
        else:
            dp2[i] += 1
    if dp1==dp2:
        return 'YES'
    else:
        return 'NO'

if __name__ == '__main__':
    a=""
    b=""
    print(check_anagram(a,b))

